ISLAMABAD, Aug 08 (APP):Outgoing Chairman Federal Board of Revenue (FBR) Malik Amjad Zubair Tiwana called on Prime Minister Shehbaz Sharif here on Thursday.
The prime minister praised Malik Amjad for his services for the country and expressed best wishes for his future.
